import React from 'react';

const Navigation = () => {
  return (
    <nav>
      
    <div className="logo">
       <span>ABC Pharmacy</span>
    </div> 
    
    <div className='Left'>
    <a href="#">Home</a>
    <a href="#">Products</a>
    <a href="#">About Us</a>
    <a href="#">Contact Us</a>
    </div>
  </nav>
  );
}

export default Navigation;
